import React, { useState } from 'react';


const CreatePageForm = () => {
    const [title, setTitle] = useState('');

    return (
        <div className="inputs">
            <input 
                type='text'
                onChange={(e) => setTitle(e)}
                value={title}
            />
        </div>
    )
}

export default CreatePageForm;
